Worth noting;
For all their goals scored this season, Fulham can only finish with a max. of 96 points i.e. 1 less than #NCFC did last season in the Champ.
They've also already conceded 2 more goals (with 3 games left to play) than Norwich did.

A little bit of #NCFC perspective;
Over the last 20 years our average league position is 5th in championship so we're currently above average.

Only 5 times in those 20 years have we finished above our last 4 league finishes.  It's not perfect, but it has been far worse recently

